  img: {
    marginTop: 0,
    marginLeft: 0,
    width: '100%',
    height: '100%'
    // borderRadius: 10
  }
};

const MainCarousel = () => {
  return (
    <div style={styles.carouselDiv}>
      <Carousel
        showStatus={false}
        showThumbs={false}
        infiniteLoop={true}
        width="100%"
        autoPlay={true}
        stopOnHover={false}
        interval={7000}
        transitionTime={800}
        style={styles.carousel}
      >
        {picsArr.map((pic, index) => {
          return (
            <div style={styles.imgDiv}>
              <img src={pic} alt="scenery" key={index} style={styles.img} />
            </div>
          );
        })}
      </Carousel>
    </div>
  );
};

export default MainCarousel;
